#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>
#include <string.h>


int lengthOfLongestSubstring(char* s)
{
    int ascii[128];
    int begin = 0;
    int idx_prev;
    int max_len = 0;
    
    //printf("\n");
    memset(ascii, -1, 128*sizeof(int));
    for(int i=0; i<strlen(s); i++){
        idx_prev = ascii[s[i]];
        ascii[s[i]] = i;
        //printf("[%c], i = %d, idx_prev = %d, begin = %d\n",s[i], i, idx_prev, begin);
        if(idx_prev >= begin){
            begin = idx_prev + 1;
        }
        else{
            max_len = (max_len>(i-begin+1)) ? max_len : (i-begin+1);
        }
    }
    return max_len;
}

